/// <summary>
/// Analyzes whether form can be closed.
/// </summary>
/// <returns>
/// True if form can be closed, false - if some conflicts are detected in forms data and user action wasn't Cancel.
/// </returns>
public boolean  canClose()
{
    purchAgreementGenerateReleaseOrder.parmReleaseOrderLine(tmpPurchLine);
    purchAgreementGenerateReleaseOrder.parmReleaseOrderTable(tmpPurchTable);

    if (!element.closedOk())
    {
        return super();
    }

    if (!purchAgreementGenerateReleaseOrder.check())
    {
        tmpPurchLine_ds.reread();
        tmpPurchLine_ds.refresh();
        return false;
    }

    return super();
}

/// <summary>
/// Calculates whether the Inventory Dimensions field with provided ID can be editable during the release from agreement line
/// with specified RecId
/// </summary>
/// <param name="_inventDimFieldId">
/// InventDim field Id to be tested.
/// </param>
/// <param name="_agreementLineRecId">
/// RecId of the <c>AgreementLineQuantityCommitment</c> used for release.
/// </param>
/// <returns>
/// True if particular InventDim field is cached as editable, false - if not.
/// </returns>
/// <remarks>
/// Used cached information about field editability produced in init method.
/// </remarks>
public boolean canEditInventDimField(fieldId _inventDimFieldId, recId _agreementLineRecId)
{
    boolean ret = false;
    InventDimParm   inventDimEditableFields;

    if (editableInventDimFieldsPerLine && editableInventDimFieldsPerLine.exists(_agreementLineRecId))
    {
        inventDimEditableFields = editableInventDimFieldsPerLine.lookup(_agreementLineRecId);

        ret = inventDimEditableFields.isFieldIdEnabled(_inventDimFieldId);
    }
    return ret;
}

/// <summary>
/// Copies delivery address information to the line.
/// </summary>
public void copyAddressToLine()
{
    TmpPurchLine tmpPurchLineLocal;

    ttsbegin;

    tmpPurchLineLocal.setTmpData(tmpPurchLine);

    while select tmpPurchLineLocal
    {
        tmpPurchLineLocal.DeliveryPostalAddress = tmpPurchTable.DeliveryPostalAddress;
        tmpPurchLineLocal.DeliveryName          = tmpPurchTable.DeliveryName;
        tmpPurchLineLocal.AddressRecId          = tmpPurchTable.AddressRefRecId;
        tmpPurchLineLocal.AddressRefTableId     = tmpPurchTable.AddressRefTableId;

        tmpPurchLineLocal.doUpdate();
    }

    ttscommit;

    tmpPurchLine_ds.research();
}

/// <summary>
/// Initializes internal form state.
/// </summary>
public void init()
{
    int inventDimColumnCounter;

    super();

    purchAgreementGenerateReleaseOrder = element.args().caller();
    purchAgreementHeader = purchAgreementGenerateReleaseOrder.parmPurchAgreementHeader();

    purchAgreementGenerateReleaseOrder.createReleaseOrderTable(tmpPurchTable);
    purchAgreementGenerateReleaseOrder.createReleaseOrderLine(tmpPurchLine);

    // Init a cached map of editable Inventory Dimensions fields per purchase agreement line...
    editableInventDimFieldsPerLine = new Map (Types::Int64,Types::Record);

    // ...populate it with information
    editableInventDimFieldsPerLine = purchAgreementGenerateReleaseOrder.getEditableInventDimFieldsPerLines();

    element.updateDesign (InventDimFormDesignUpdate::Init);

    inventDimColumnCounter = conLen(inventDimFormSetup.dimFieldsActive(inventDimFormSetup.parmDimParmVisibleGrid()));

    pdsCWFormCtrl = PdsCWFormCtrl_PurchAgreeReleaseOrder::newFromForm(this,tmpPurchLine);
}

