/// <summary>
/// Sets AllowEdit property for the data source field
/// </summary>
/// <param name="_fieldId">
/// Id of the field to set.
/// </param>
protected void setUpEditableInventDimField(fieldId _fieldId)
{
    FormDataObject inventDimFieldObject;
    boolean canEdit;

    inventDimFieldObject = this.object(_fieldId);

    if (_fieldId &&  inventDimFieldObject)
    {
        canEdit = element.canEditInventDimField(_fieldId, tmpPurchLine.AgreementLineQuantityCommitment);
        inventDimFieldObject.allowEdit(canEdit);
    }
}

/// <summary>
/// Sets AllowEdit property for inventory dimensions fields depending on the inventory dimensions set-up for the active
/// line
/// </summary>
/// <remarks>
/// Watches only the following fields: configId, InventSizeId, InventColorId, InventStyleId, InventVersionId, InventSiteId, InventLocationId
/// </remarks>
protected void setUpEditableDimensions()
{
    List            dimFieldsList   = InventDim::dimProductDimFieldList();
    ListEnumerator  enumerator      = (dimFieldsList) ? dimFieldsList.getEnumerator() : null;
    fieldId curInventDimFieldId;

    // Set up editability of product dimension fields...
    if (enumerator)
    {
        while (enumerator.moveNext())
        {
            curInventDimFieldId = enumerator.current();
            this.setUpEditableInventDimField(curInventDimFieldId);
        }
    }

    // Set up editability of InventSiteId field...
    curInventDimFieldId = fieldNum(InventDim, InventSiteId);
    this.setUpEditableInventDimField(curInventDimFieldId);

    // Set up editability of InventLocationId field...
    curInventDimFieldId = fieldNum(InventDim, InventLocationId);
    this.setUpEditableInventDimField(curInventDimFieldId);
}

public int active()
{
    int ret;

    ret = super();

    this.setUpEditableDimensions();

    return ret;
}

